import React from 'react'
import { Row, Col, Image, ListGroup, Button, Card, Form } from 'react-bootstrap'



function FormContainer({children}) {
  return (
    <Container>
        <Row className='jystify-content-md-center'>
            <Col xs={12} md={6}>
                {children}
            </Col>
        </Row>
    </Container>
  )
}

export default FormContainer
